import React from 'react';
import logo from './logo.svg';
import './App.css';
import BooksRead from './components/booksRead';
import BooksReading from './components/booksReading';
import BooksToBeRead from './components/booksToBeRead';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav } from 'react-bootstrap';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

class App extends React.Component {
  render(){
    return (
      <Router>
        <div className = "App">
        <Navbar bg="primary" variant="dark">
              <Nav className="mr-auto">
                <Nav.Link href="/booksRead">Books Read</Nav.Link>
                <Nav.Link href="/booksReading">Books Reading</Nav.Link>
                <Nav.Link href="/booksToBeRead">Books To Be Read</Nav.Link>
              </Nav>
            </Navbar>

            <Switch>
              <Route path="/booksRead" component={BooksRead}/>
              <Route path="/booksReading" component={BooksReading}/>
              <Route path="/booksToBeRead" component={BooksToBeRead}/>
            </Switch>
        </div>
      </Router>

    );
  }

}

export default App;
